const Form = props => (
    <form className="form-container" onSubmit={props.getWeather}>
        <label>CITY</label>
        <input className="city-container" type="text" name="city" defaultValue="PALA" placeholder="Enter city" /><br/>
        <input className="country-container" type="text" name="country" defaultValue="IN" placeholder="Enter country" /><br/>
        <button>Get Weather</button>
    </form>
);

export default Form;
